script: |
  super -f text -I q9600.spq | sort > q9600.out

inputs:
  - name: q9600.spq
    data: |
      SELECT DISTINCT - COUNT ( * ) FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab1 (FORMAT parquet) WHERE NOT ( NULL ) IS NOT NULL;
  - name: tab0
  - name: tab1

outputs:
  - name: q9600.out
    data: |
      -9
